import React from 'react';
import './Projects.css';
import Rocket from '../rocket.png';

function Projects() {
  const projects = [
    {
      img: '../musicplayer.png',
      name: 'Music Player',
      desc: 'Quick project to make a simple music player. Uses data from songs and images that I like. I created a small database for a few songs and images that it pulls from.',
      lang: ['HTML', 'CSS', 'JavaScript'],
      link: 'https://afdesignsmusicplayer.netlify.app',
    },
    {
      img: '../crypto.png',
      name: 'Crypto Tracker',
      desc: 'Quick project to make a simple music player. Uses data from songs and images that I like. I created a small database for a few songs and images that it pulls from.',
      lang: ['React'],
      link: 'https://afdesignscryptotracker.netlify.app',
    },
    {
      img: '../bmi_calc.png',
      name: 'BMI Calc',
      desc: 'Quick project to make a simple music player. Uses data from songs and images that I like. I created a small database for a few songs and images that it pulls from.',
      lang: ['HTML', 'CSS', 'JavaScript', 'Bootstrap'],
      link: 'https://afdesignsbmicalc.netlify.app',
    },
  ];

  return (
    <div className='Projects'>
      <div className='projects__container'>
        <h1>Projects</h1>
        <img className='rocket' src={Rocket} alt='rocket' />
        <div className='projects'>
          <ul>
            {projects.map((p) => {
              <li>
                <div className='left'>
                  <img src={p.img} alt={p.name} />
                </div>
                <div className='right'>
                  <h3>{p.name}</h3>
                  <p>{p.desc}</p>
                  <ul>
                    {p.lang.map((l) => (
                      <li>{l}</li>
                    ))}
                  </ul>
                  <a className='cta' href={p.link}>
                    Check it Out
                  </a>
                </div>
              </li>;
            })}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Projects;
